webpackJsonp([0x6be5cde988db],{262:function(n,b){n.exports={data:{markdownRemark:{html:"<h1>В&nbsp;КЛЮВИКАХ</h1>\n<section>\n<p>Однажды я проснулся нараспев!<br>\nСлучайно я проснулся нараспашку — <br>\nмне всё казалось талым, как во сне,<br>\nи мятым, словно рукава рубашки.</p>\n<p>А я был запонкой железной и сверчком!<br>\nЯ свечкой был! Я утру был не равен!<br>\nОно меня будило маяком,<br>\nа я переболел, перенаправил.</p>\n<p>Да, я проснулся, но совсем не спал,<br>\nи высунулся в середину утра.<br>\nЯ встал ногами прямо на диван<br>\nи закричал, что счастлив был как будто!</p>\n</section>"}},pathContext:{slug:"lyrics/vKluvikah"}}}});
